import './App.css';
/** @jsx jsx */
import { jsx } from '@emotion/core'
import { Typography } from "@material-ui/core";

const styles = {
  header: {
    height: '60px',
    backgroundColor: 'rgba(255,255,255,.3)',
    flexShrink: 0,
  },
  headerLogIn: {
    backgroundColor: 'red',
  },
  headerLogOut: {
    backgroundColor: 'blue',
  },
}

export default () => {
  return (
    <Typography color="primary" variant="h1">Hello there</Typography>  
  );
}
